import apiServices, { BASE_URL_IMG } from '../ApiServices/ApiServices'
import { toast, ToastContainer } from 'react-toastify'
import { Link } from "react-router-dom";
import axios from "axios";
import cake from "../photo/cake.jpg"
export default function Home() {

        const [product, setProduct] = useState([]);
        const [loading, setLoading] = useState(true);
        const [url,setUrl]=useState({})
        const[imageUrl, setImageUrl]=('data:image/jpeg;base64,')
        useEffect(()=>{
            const getbanner= async ()=>{
                try {
                    const res = (await axios.get("http://localhost:5000/banner/showbanner"))
                    setUrl(res)
                    // console.log("calling getbanner")


                } catch (error) {
                    console.log(error,"error in banner")

                }

            }
            getbanner()
            // if(url){
            //     console.log("aman",url.data.banner[2].imageUrl)

            //     const last = url.data.banner.length;

            //     const imageUrl = url.data.banner[last-1].imageUrl;
            //     // if(imageUrl){
            //     //     imageAdd = imageUrl;
            //     // }

            //     console.log("image response",imageUrl, "    " , last)
            // }


        },[])
        console.log("Data response",url)

        const imageAdd  = '';









