          setTimeout(() => {
              setLoading(false);
          }, 1500);
          apiServices.getallProduct()
              .then((data) => {
                  if (data.data.success) {

                      setProduct(data.data.data);

                  } else {
                      toast.error(data.data.msg);
                  }
              })
              .catch((err) => {

                  toast.error("Something went wrong");
              });
            }, [loading]);
  return (
   <>

